import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { AddBookComponent } from './add-book/add-book.component';
import { DeleteBookComponent } from './delete-book/delete-book.component';
import { MOdifyBookComponent } from './modify-book/modify-book.component';
import { ViewABookComponent } from './view-abook/view-abook.component';
import { ViewAllBooksComponent } from './view-all-books/view-all-books.component';
import { FormsModule } from '@angular/forms';
import { BankAccountComponent } from './bank-account/bank-account.component';
import { PalindromePipe } from './palindrome.pipe';
import { HomeComponent } from './home/home.component';
import { LoginComponent } from './login/login.component';
import { RegistrationComponent } from './registration/registration.component';
import { LikedislikeComponent } from './likedislike/likedislike.component';

@NgModule({
  declarations: [
    AppComponent,
    AddBookComponent,
    DeleteBookComponent,
    MOdifyBookComponent,
    ViewABookComponent,
    ViewAllBooksComponent,
    BankAccountComponent,
    PalindromePipe,
    HomeComponent,
    LoginComponent,
    RegistrationComponent,
    LikedislikeComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
